«Программа снижения веса»

Чтобы добиться стабильных результатов в снижении веса, нужно последовательно пройти три этапа:

— Программа «Старт» (обязательно);

— Программа «Закрепление результата» (обязательно);

— Программа «Контроль» (желательно).

Внимание! Не допускается ни в коем случае самостоятельное изменение, дополнение в программу снижения веса (голодание, использование допол­нительно каких-либо слабительных чаев и т.п.).
